?><p style="text-align: justify;"><span style="font-size: medium;"><span style="font-family: &quot;Times New Roman&quot;;">Эта знаменитая компания по производству первоклассных часов, была основана в далеком 1861 году. Ее основал Эрхард Юнханс в городе Шрамберг. Но спустя 14 лет, он передал управление компанией своему сыну высококлассному часовщику Артуру Юнхансу. За всю свою длинную историю, компания смогла добиться огромнейшей популярности по всему миру. Более половины миллиарда проданных часов, являются прямым доказательством этого утверждения. В принципе, это не удивительно, потому что компании Junghans принадлежит множество разработок в часовом производстве. В 1970 году компания разработала первый кварцевый механизм, в 1979 часы с календарем, а 1989 году первые в мире радиоконтролируемые часы. Кстати, компания Junghans была официальным поставщиком часов на Олимпийских играх, которые проходили в Мюнхене. Концепция компании заключается в производстве точнейших измерителей времени. Интересно, что эти часы автоматически настраивают точное время, соединяясь при помощи антенны. Да и заряжаются они от солнечных батареек. Стоит отметить, что Junghans выпускает не только наручные, но и настенные и настольные часы. В 2003 и в 2004 году компания заняла первое место в известном часовом журнале, в качестве бренда, которому больше всего доверяет вся Европа. Компания Junghans всегда готова удивлять часовую общественность своими изобретениями и дизайнерскими решениями, при этом, соблюдая все традиции часоделия.</span></span></p>
 
